import React from 'react';
import './styles.css';

const OfferDisplay = (props) => {
  return (
    <a href={props.link} target='_blank'>
      <img className='offer-logo' src={props.logoUrl} />
      <div className='offer-price'>{props.price}</div>
    </a>
  );
};

export default OfferDisplay;
